import React from 'react';

function Card(props) {
  return (
    <div>
      <h2>{props.item.title}</h2>
      <p>{props.item.content}</p>

      {Object.keys(props.item.links).map((key, index) => {
        const link = props.item.links[key];
        let linkName = key;

        return (<span><a href={link}>{linkName}</a>{'  '}</span>)
      })}

    </div>
  );
}
export default Card;
